import React, { Component } from 'react';
import {connect} from 'react-redux';
import './dashboard.css';
import * as actions from '../../actions/dashboard';
import Sidebar from '../sidebar/sidebar';
import DashboardContent from './dashboardContent/dashboardContent'
import { Route } from 'react-router-dom';
import CourseContent from './courseContent/courseContent'

class Dashboard extends Component {

	constructor(props){
		super(props) ;

		this.state = {
            user_id: '125',

		}
	}

    componentDidMount() {
        this.setState({
            user_id: this.props.user_id
        })
        console.log("Did mount")
        console.log(this.state.user_id);
        this.props.getDashboardcourses(this.state.user_id);
    }

    componentWillReceiveProps(newProps) {
        console.log('Will Receive Props ' , newProps)
        this.setState({
            user_id: newProps.state.user_id
        })

	}

    render() {
        return (
            	<div >

                    <div className="content-area ">

                        <Route exact path="/dashboard/d" render={() => (
                            <DashboardContent />
                        )}/>

                        <Route exact path='/dashboard/courses' render={() => (
                            <CourseContent />
                        )}/>
                    </div>



                </div>
        );
    }
}


function mapStateToProps(state) {

    return {
        user_id: state.dashboard.user_id,
        course_list: state.dashboard.course_list
    };
}

function mapDispatchToProps(dispatch) {

    return {
        getDashboardcourses : (user_id) => dispatch(actions.getDashboardcourses(user_id))
    };
}

export default connect(mapStateToProps,mapDispatchToProps)(Dashboard);
